func testGenerator() {
	f, _ := cairo.NewSurfaceFromPNG("res/raw-logo-color.png")
	k := LogoGenerator.NewLogoGenerator(f, "Applied Science University")
	img := k.GetLogoWithText(250.0)
	img.WriteToPNG("final.png")
	img.Finish()
	f.Finish()
}

func createImageFromB64(imgb64 string, fileName string) {
	unbased, err := base64.StdEncoding.DecodeString(imgb64)
	if err != nil {
		panic("Cannot decode b64")
	}

	r := bytes.NewReader(unbased)
	finalImg, err0 := png.Decode(r)
	if err0 != nil {
		panic("Bad png")
	}

	imageFile, err1 := os.OpenFile(fmt.Sprintf("%s.png", fileName), os.O_WRONLY|os.O_CREATE, 0755)
	if err1 != nil {
		panic("Cannot open file")
	}

	png.Encode(imageFile, finalImg)
}

func getImage(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "application/json")
	parameters := mux.Vars(r) // { "uni_name": "eg ASU" }
	s, _ := cairo.NewSurfaceFromPNG("res/logo.png")
	gen := LogoGenerator.NewLogoGenerator(s, parameters["uni_name"])
	gen.Text = parameters["uni_name"]

	newBlyat := gen.GetLogoWithText(86.0)
	newBlyat.WriteToPNG("new-logo.png")
	cont, _ := ioutil.ReadFile("new-logo.png")
	gen.Logo.Finish()

	fmt.Println(base64.StdEncoding.EncodeToString(cont))
	img := []image{{base64.StdEncoding.EncodeToString(cont)}}
	j, _ := json.Marshal(img)
	fmt.Fprintln(w, string(j))
	//json.NewEncoder(w).Encode(img)
}
